Defendant in custody.  
State moves to amend the date of violation on Count 4 from the 27th to the 28th.  Motion granted.  State moves to delete the enhancers of Second and subsequent offense, contrary to Section 961.48(1)(b) of the Wisconsin Statutes on Counts 2 and 4.  Motion granted.   
Count 2 - Deliver Cocaine (>1-5g) - No contest plea. 
Count 4 - Deliver Cocaine (>1-5g) - No contest plea.  Convicted.  State moves to dismiss and read in counts 1 and 3.  Motion granted.  Defendant is sentenced to the Wisconsin State Prison System for a total sentence of six (6) years, on each count, concurrent.  Two and one-half (2 1/2) years initial confinement, followed by three and one-half (3 1/2) years extended supervision.  Conditions of extended supervision are:
1) Re-payment of buy money of $1,070.00;
2) Have no contact with any known drug users or dealers;
3) Submit to random urine screens and pay for same;
4) Take medications that are only prescribed to him and use only one physician and pharmacy;
5) Provide DNA sample and pay surcharge;
6) Pay supervision fees in an amount to be determined by DOC;
7) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process.
Court finds the defendant is eligible for the Challenge Incarceration Program and the Substance Abuse Program.  
Defendant is entitled to 133 days sentence credit. 
